import React, {Component} from 'react';
import { PROFILE_PIC_URL_PREFIX, TEAM_PIC_URL_PREFIX } from '../Constants';

export class Profile extends Component {


    render() {
        const {
            teamAbbreviation,
            teamCity,
            teamName,
            playerName,
            height,
            weight,
            playerId,
            pts, reb, ast, pie,
        } = this.props.playerInfo;

        return (
            <div className="profile">
                This is profile
            </div>
        );
    }
}
